INSERT INTO `email_content` VALUES (1, 'Certified Quality: Trust Our ISO and CE Certified Gloves', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>Title</title>\r\n</head>\r\n<body style=\" font-family: Arial, sans-serif;\r\n            background-color: #f5f5f5;\r\n            color: #333333;\r\n            margin: 0;\r\n            padding: 20px;\">\r\n<div style=\"font-size: 16px;\r\n            line-height: 1.6;\r\n            background-color: #ffffff;\r\n            max-width: 600px;\r\n            padding: 20px;\r\n            border-radius: 8px;\r\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\">\r\n<p>Dear Manager,</p>\r\n<p>Hello!</p>\r\n<p>This is Una from <span style=\"font-weight: bold\">Sunwei Industrial Co., Ltd.</span>, specializing in the production of high-quality gloves, including <br>\r\n    <span style=\"font-weight: bold\">Latex gloves, Nitrile gloves, Vinyl and PE gloves.</span> Our gloves are <span style=\"font-weight: bold\">ISO and CE </span>certified with guaranteed quality,\r\n    <br>which widely used in medical, food processing, cleaning, and other industries.\r\n</p>\r\n<p>Our stable and competitive pricing can help you better predict and control your costs.</p>\r\n<p>We believe our products can meet your company\'s needs and help improve your business efficiency.</p>\r\n<p>Any interest,samples with more product details and the latest price could be sent for your reference.</p>\r\n<p>We look forward to the opportunity to collaborate with you.</p>\r\n<img src=\"cid:content1.png\" alt=\"glove image\">\r\n<p>Best regards,<br>\r\nUna Huang\r\n</p>\r\n<p></p>\r\n<p>Sunwei Industrial Co., Ltd.<br>\r\nEmail: sales2@sunweiglove.com<br>\r\nTell & Whats app:+86-13751336933<br>\r\nECONOMIC DEVELOPMENT ZONE,CAOXIAN COUNTY, SHANDONG PROVINCE, P.R. CHINA.<br>\r\n    <span style=\"color: yellowgreen\">Please consider the environment before printing this e-mail.</span><br>\r\n</p>\r\n</div>\r\n</body>\r\n</html>\r\n', '[1]', 1, '2024-08-10 11:32:54', NULL);
INSERT INTO `email_content` VALUES (2, 'Experience Exceptional Customer Support for Your Glove Orders', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>Title</title>\r\n</head>\r\n<body style=\" font-family: Arial, sans-serif;\r\n            background-color: #f5f5f5;\r\n            color: #333333;\r\n            margin: 0;\r\n            padding: 20px;\">\r\n<div style=\"font-size: 16px;\r\n            line-height: 1.6;\r\n            background-color: #ffffff;\r\n            max-width: 600px;\r\n            padding: 20px;\r\n            border-radius: 8px;\r\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\">\r\n<p>Hello Dear,</p>\r\n<p>Greetings!</p>\r\n <p>We are <span style=\"font-weight: bold\">Sunwei Industrial Co., Ltd</span>, specializing in the production of <span style=\"font-weight: bold\"> high-quality disposable gloves</span>. <br>\r\n    Our gloves are durable, comfortable, and suitable for various industry needs.\r\n</p>\r\n<p>We know that unreliable supply chains can cause severe disruptions. Our efficient production and logistics ensure a steady and reliable supply of high-quality gloves, even during peak demand periods.\r\n        <br>We pride ourselves on our ability to maintain a consistent supply of high-quality disposable gloves.\r\n</p>\r\n<p>We hope to become your trusted partner, ensuring you never face shortages again,please reach out to discuss how we can benefit your company.</p>\r\n<p> Looking forward to your contact.</p>\r\n<img src=\"cid:content2-1.png\" alt=\"glove image\"><img src=\"cid:content2-2.png\" alt=\"glove image\">\r\n<img src=\"cid:content2-3.png\" alt=\"glove image\"><img src=\"cid:content2-4.png\" alt=\"glove image\">\r\n<p>Best regards,<br>\r\nUna Huang\r\n</p>\r\n<p></p>\r\n<p>Sunwei Industrial Co., Ltd.<br>\r\nEmail: sales2@sunweiglove.com<br>\r\nTell & Whats app:+86-13751336933<br>\r\nECONOMIC DEVELOPMENT ZONE,CAOXIAN COUNTY, SHANDONG PROVINCE, P.R. CHINA.<br>\r\n<img src=\"cid:content2-5.png\" alt=\"glove image\">\r\n    <span style=\"color: yellowgreen\">Please consider the environment before printing this e-mail.</span><br>\r\n	\r\n</p>\r\n</div>\r\n</body>\r\n</html>\r\n', '[2, 3, 4, 5, 10]', 2, '2024-08-10 11:32:57', '2024-08-22 11:45:37');
INSERT INTO `email_content` VALUES (3, 'Lock in Stable Pricing for Your Disposable Glove Needs', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>Title</title>\r\n</head>\r\n<body style=\" font-family: Arial, sans-serif;\r\n            background-color: #f5f5f5;\r\n            color: #333333;\r\n            margin: 0;\r\n            padding: 20px;\">\r\n<div style=\"font-size: 16px;\r\n            line-height: 1.6;\r\n            background-color: #ffffff;\r\n            max-width: 600px;\r\n            padding: 20px;\r\n            border-radius: 8px;\r\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\">\r\n<p>Hello Dear,</p>\r\n<p> I am a sales representative from <span style=\"font-weight: bold\">Sunwei Industrial Co., Ltd</span>. We understand that inconsistent quality in disposable gloves can disrupt your operations and lead to significant issues. Our gloves undergo rigorous quality control to ensure that each pair meets the highest standards.\r\n</p>\r\n<p>We would love the opportunity to provide you with reliable and high-quality gloves,as well as competitive prices to support your business.\r\n    If you need a sample, please feel free to contact me,look forward to your response.\r\n</p>\r\n<img src=\"cid:content3.png\" alt=\"glove image\">\r\n<p>Best regards,<br>\r\nUna Huang\r\n</p>\r\n<p></p>\r\n<p>Sunwei Industrial Co., Ltd.<br>\r\nEmail: sales2@sunweiglove.com<br>\r\nTell & Whats app:+86-13751336933<br>\r\nECONOMIC DEVELOPMENT ZONE,CAOXIAN COUNTY, SHANDONG PROVINCE, P.R. CHINA.<br>\r\n    <span style=\"color: yellowgreen\">Please consider the environment before printing this e-mail.</span><br>\r\n</p>\r\n</div>\r\n</body>\r\n</html>\r\n', '[6]', 3, '2024-08-10 11:32:59', '2024-08-22 10:22:10');
INSERT INTO `email_content` VALUES (4, 'Latex Allergies? Our Gloves Offer a Safe Alternative', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <title>Title</title>\r\n</head>\r\n<body style=\" font-family: Arial, sans-serif;\r\n            background-color: #f5f5f5;\r\n            color: #333333;\r\n            margin: 0;\r\n            padding: 20px;\">\r\n<div style=\"font-size: 16px;\r\n            line-height: 1.6;\r\n            background-color: #ffffff;\r\n            max-width: 600px;\r\n            padding: 20px;\r\n            border-radius: 8px;\r\n            box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);\">\r\n<p>Hello Dear,<br>\r\nGreetings!\r\n</p>\r\n    <p>  I am Una Huang from <span style=\"font-weight: bold\">Sunwei Industrial Co.</span>, Ltd.We understand that latex allergies are a significant concern for many users. Our nitrile and vinyl gloves are latex-free, providing a safe alternative for those with latex sensitivities.\r\n</p>\r\n<p>we would love to provide you with samples to demonstrate our commitment to quality, as well as quotation for your evaluation. Looking forward to your contact.</p>\r\n<img src=\"cid:content4-1.png\" alt=\"glove image\">\r\n<img src=\"cid:content4-2.png\" alt=\"glove image\">\r\n<img src=\"cid:content4-3.png\" alt=\"glove image\">\r\n<p>Best regards,<br>\r\nUna Huang\r\n</p>\r\n<p></p>\r\n<p>Sunwei Industrial Co., Ltd.<br>\r\nEmail: sales2@sunweiglove.com<br>\r\nTell & Whats app:+86-13751336933<br>\r\nECONOMIC DEVELOPMENT ZONE,CAOXIAN COUNTY, SHANDONG PROVINCE, P.R. CHINA.<br>\r\n<img src=\"cid:content4-4.png\" alt=\"glove image\">\r\n    <span style=\"color: yellowgreen\">Please consider the environment before printing this e-mail.</span><br>\r\n	\r\n</p>\r\n</div>\r\n</body>\r\n</html>\r\n', '[7, 8, 9, 11]', 4, '2024-08-10 11:33:02', '2024-08-22 10:24:03');
